import React from "react";
import homeOne from '../assets/Images/Brew-Story/stat1.jpg';
import homeTwo from '../assets/Images/Brew-Story/ban2.png';
// import homeThree from '../assets/Images/Brew-Story/ban4.jpg';
// import homeTwo from "/src/assets/Images/Brew-Story/staticHome2.jpg";

function StaticHomeHeader(props) {
  return (
    <div>
      <div id="carouselExampleDark" class="carousel carousel-dark slide bg-dark">
  <div class="carousel-indicators">
    <button type="button" data-bs-target="#carouselExampleDark" data-bs-slide-to="0" class="active" aria-current="true" aria-label="Slide 1"></button>
    <button type="button" data-bs-target="#carouselExampleDark" data-bs-slide-to="1" aria-label="Slide 2"></button>
    <button type="button" data-bs-target="#carouselExampleDark" data-bs-slide-to="2" aria-label="Slide 3"></button>
  </div>
  <div class="carousel-inner">
    <div class="carousel-item active" data-bs-interval="10000">
      <img src={homeOne} class="d-block w-100" alt="..." />
      <div class="carousel-caption d-none d-md-block">
        <button>First slide label</button>
        <p>Some representative placeholder content for the first slide.</p>
      </div>
    </div>
    <div class="carousel-item" data-bs-interval="2000">
      <img src={homeTwo} class="d-block w-100" alt="..." />
      <div class="carousel-caption d-none d-md-block">
        <h5>Second slide label</h5>
        <p>Some representative placeholder content for the second slide.</p>
      </div>
    </div>
  </div>
  <button class="carousel-control-prev" type="button" data-bs-target="#carouselExampleDark" data-bs-slide="prev">
    <span class="carousel-control-prev-icon" aria-hidden="true"></span>
    <span class="visually-hidden">Previous</span>
  </button>
  <button class="carousel-control-next" type="button" data-bs-target="#carouselExampleDark" data-bs-slide="next">
    <span class="carousel-control-next-icon" aria-hidden="true"></span>
    <span class="visually-hidden">Next</span>
  </button>
</div>
    </div>
  );
}

export default StaticHomeHeader;
